  $(document).ready(function(){
    var available_ids = []
    $('#d-list li').each(function(){
      available_ids.push(this.id)
    })
    $('#progress').val(available_ids.length *10);
    if(available_ids.length < 7){
      var percent = (available_ids.length / 7).toString().substring(2,4)
    }else{
      var percent = '100'
    }
    $('#percent').prepend(percent);

    if((available_ids.length / 7) < .60){
      $('#yellow').hide()
      $('#red').hide()
      $('#green').show()
    }else if((available_ids.length / 7) <= .90){
      $('#yellow').show()
      $('#red').hide()
      $('#green').hide()
    }else{
      $('#yellow').hide()
      $('red').show()
      $('#green').hide()
    }

    if($.cookie('checked') == 'true'){
      $("#check_pie").prop("checked", true);
      (function loop() {
        var rand = Math.round(Math.random() * (3000 - 500)) + 1000;
        setTimeout(function() {
          randomize();
          loop();
        }, rand);
      }());
    }
    function randomize() {

      var random = Math.floor(Math.random() * available_ids.length-1) + 1
      console.log(available_ids[random])
      var id = available_ids[random]
      var new_value = Math.floor(Math.random() * 5) + 2
      var data ={}
      data['value'] = new_value
      $.ajax({
      url: "/dashboard/"+id,
      dataType: 'json',
      method: "PATCH",
      data: data,
      success: function(result){
        window.location.href = '/';
      }
      })
    };
    $('#check_pie').on('click',function(){
      if($('#check_pie').is(':checked')){
        $.cookie('checked',true, {path: '/'})
        (function loop() {
          var rand = Math.round(Math.random() * (3000 - 500)) + 2000;
          setTimeout(function() {
            randomize();
            loop();
          }, rand);
        }());
      }else{
        $.cookie('checked',false, {path: '/'})
      }
    })

    $('#modal-button').on('click',function(){
      var available_ids = []
      $('#d-list li').each(function(){
        available_ids.push(this.id)
      })
      if (available_ids.length <=6){
        $('#myModal').modal();
        $('#modal-submit').on('click',function(){
          var label = ($('#label').val());
          var color = ($('#color').val());
          var value = ($('#value').val());
          var data ={}
          data['label'] = label
          data['value'] = value
          data['color'] = color
          $.ajax({
          url: "/dashboard",
          dataType: 'json',
          method: "POST",
          data: data,
          success: function(result){
            window.location.href = '/';
          }
          })
        })
      }else{
        alert('You have too many projects running at the moment')
      }
    })

  });//end jquery
